import React from "react";
import {Buttons,TextBox} from "../../.././shared/components";
import "../../.././assets/index.css"
import ThumbUpAltOutlinedIcon from '@material-ui/icons/ThumbUpAltOutlined';
import ModeCommentOutlinedIcon from '@material-ui/icons/ModeCommentOutlined';
import { NavLink } from "react-router-dom";

const Feeds = ({userName, imageUrl, text}) =>{
    return (
        <div className="postDetails card" style={{padding:"5px"}}>
            <div>
                <div>
                    <h6 id="postedBy">{userName}</h6>
                </div>
                <div className="postDetails-content card">
                    <div className="postText">
                        <p id="text">Hellu there</p>
                    </div>
                    <img className="postImage"></img>
                </div>
                <div className="postDetails-button">
                    {/* <div>
                        <Buttons value="Like"/>
                    </div>
                    <div style={{marginLeft:"10px"}}>
                        <Buttons value="Comment"/>
                    </div> */}
                    <div>
                        <ThumbUpAltOutlinedIcon className="likeButton" style={{marginLeft:"10px", fontSize:"30px"}}></ThumbUpAltOutlinedIcon>
                    </div>
                    <div>
                        <ModeCommentOutlinedIcon className="likeButton" style={{fontSize:"30px", marginLeft:"10px"}}></ModeCommentOutlinedIcon>
                    </div>
                </div>
            </div>
        </div>
    );
}

export default Feeds;
